// SPDX-License-Identifier: Apache-2.0
import { Int } from "../codec/Int.js";
/**
 * @name i8
 * @description
 * An 8-bit signed integer
 */

export class i8 extends Int.with(8) {
  constructor(...args) {
    super(...args);
    this.__IntType = 'i8';
  }

}
